Despite corporate policy, Sam Freeman intends to wine and dine his lovely co-worker. Unfortunately, his hopes of a romantic dinner are shattered when the boss shows up. After two foul mouth FBI Agents and the town plumber invite themselves to the party, all hell breaks loose... And that's only the beginning.

Feature runtime 29 minutes, DVD is loaded with extras!

